import React from "react";
import "./App.css";

const App = () => {

  return (
    <div className="App">
      <h1>Image Slider</h1>
      <form class="range-field my-5">
      <input id="calculatorSlider" class="no-border" type="range" value="0" min="0" max="30" />
    </form>
    </div>
  );
}

export default App;
